List of Skits in the Extended Version of Episode 2:

1. A Tusken Raider flees a bar when the bartender comes up behind him. Obi-Wan tells the bartender that they startle easily, but will return in greater numbers.

2. Anakin returns to the Lars homestead with the body of his mother. Padme, Owen and Beru start laughing when they call him &quot;Little Orphan Annie.&quot; Later, just before Owen and Beru are killed in A New Hope, the stormtrooper says they may now laugh at the joke before they are burned alive.

3. Before entering the bounty hunter meeting, Dengar asks Bossk what recent bounty hunter adventures he had. The scene cuts back to Bossk fighting his adversaries in similar to the opening scene of Indiana Jones and the Temple of Doom; Bossk then replies &quot;Not much.&quot;




